import { Button, makeStyles, Table, TableBody, TableCell, TableHead, TableRow } from '@material-ui/core';
import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom'




const useStyle= makeStyles({
    table: {
        width: '90%',
        margin: '10px 0 0 0',
        fontSize:'50'   
    },
    thead:{
        '& > *':{
            background: '#000000',
            color: '#ffffff'
        }
    }
})
export default function Designationlist() {

    const classes=useStyle();
    const [users, setUsers] = useState([]);



    return (
        <div>
            <Link to="/adddesignation" className="btn btn-primary mt-3">Add Designation</Link>
            <Table className={classes.table}>
                    <TableHead>
                        <TableRow className={classes.thead}>
                            <TableCell>Id</TableCell>
                            <TableCell>Name</TableCell>
                            <TableCell>Email</TableCell>
                            <TableCell>Contact Number</TableCell>
                            <TableCell>Action</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {
                            users.map(user=>(
                                <TableRow key={user.id}>
                                    <TableCell>
                                        {user.id}
                                    </TableCell>
                                    <TableCell>
                                        {user.name}
                                    </TableCell>
                                    <TableCell>
                                        {user.email}
                                    </TableCell>
                                    <TableCell>
                                        {user.mobile}
                                    </TableCell>
                                    <TableCell>
                                        <Button variant="contained" color="primary" style={{marginRight:10}} component={Link} to={`/edituser/${user.id}`}>Edit</Button>
                                        <Button variant="contained" color="secondary" onClick={()=>deleteUserData(user.id)} >Delete</Button>
                                    </TableCell>
                                </TableRow>
                            ))
                        }
                    </TableBody>
            </Table>
        </div>
    )
}
